sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	if (inputs.status_code == "200") {
		var response = JSON.parse(inputs.response);
		if (response.value.length > 0) {
			outputs.status = "Success";
			outputs.case_details = response;
		} else {
			outputs.status = "Error";
			inputs.error_message = "invalid_case_id";
			outputs = new MicrosoftDynamicsCRMErrorHandler()
				.getCaseDetailsErrorHandler(inputs, outputs);

		}
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.getCaseDetailsErrorHandler(inputs, outputs);
})(inputs, outputs);

